function main($)
{
	var last_supporter_id = $('.people-list li:last').data('id');

	function loadSupporters() {
		var button = $(this);

		if(!button.hasClass('disabled')) {
			button.addClass('disabled').text(button.data('loading'));

			$.getJSON(button.attr('href'), {
				i: last_supporter_id
			}).always(function(response) {
				button.attr('href', response.Supporters.LoadMoreLink);
				button.removeClass('disabled').text(button.data('loaded'));

				var count = response.Supporters.Supporters.length;

				if(count < response.Supporters.PageSize) {
					button.remove();
				}

				if(count > 0) {
					var last_id, html, list = $('.people-list:first');

					$.each(response.Supporters.Supporters, function(i, supporter) {
						html = '<li><p><strong>' + supporter.Name + '</strong>';

						if(supporter.Country) {
							html += ', ' + supporter.Country;
						}

						last_supporter_id = supporter.ID;

						list.append(html);
					});
				}
			});
		}
	}

	$('body')
		.on('click', '.js-open-menu', function(event) {
			event.preventDefault();
			$(this).parent().next('.nav-wrapper').addClass('is-opened');
		})
		.on('click', '.js-close-menu', function(event) {
			event.preventDefault();
			$(this).parent().removeClass('is-opened');
		}).on('click', '.show-more-supporters', function(event) {
			event.preventDefault();
			loadSupporters.call(this);
		}).on('click', '.menu-main a', function(){
		  $(this).closest('.nav-wrapper').removeClass('is-opened');
		})
        .on('click', "a[href*='youtube']", function (e) {
            e.preventDefault();
            lity($(this).attr('href'));
        });

	$('.counter').each(function() {
		var counter = $(this);

        $.getJSON(counter.data('url'), { for_hp: 'true' }).always(function(response) {
			var strings = $.map(response.Supporters.Supporters, function(supporter) {
                return '<strong>' + supporter.Name + '</strong>';
			});

			if (strings.length > 0)
			{
                counter.css({
                    visibility: 'visible'
                });

				$(".counter span").typed({
                    strings: strings,
                    typeSpeed: 0,
                    loop: true,
                    backDelay: 2000,
                    backSpeed: -50
                });
            }
        });
	});

	$('input[name=Country]').each(function() {
		var input = $(this);
		var value = input.val();


		var select = $('<select name="Country"></select>');

		$.each(COUNTRIES.sk, function(code, name) {
			select.append('<option value="' + code + '"' + (code == value ? ' selected="selected"' : '') + '>' + name + '</option>');
		});

		input.replaceWith(select);
	});

	if ($("#teasers-list").length > 0)
	{
        $('.teasers-list').masonry({
            // options
            itemSelector: '.grid-item',
            columnWidth: '.grid-sizer'
        });
	}
}

(function() {
    var INVOKE = true;
    var init;
    jQuery((init = function(documentready)
    {
        if (INVOKE)
        {
            main(jQuery);

            INVOKE = !documentready;
        }
        else
        {
            INVOKE = true;
        }
    }).bind(window, true));
    document.addEventListener("turbolinks:load", init.bind(window, false));
})();

jQuery(document).ready(function($) {
	'use strict';
	if(!$("#js-scrollspy").length) {
		return;
	}
	console.log('intit scrollspy');
	// Cache selectors
	var lastId,
		scrollspy = $("#js-scrollspy"),
		scrollspyHeight = scrollspy.outerHeight(),
		scrollspyOffset = scrollspy.offset().top,
		scrollspyFixed = false,
		menuHeight = $('#js-scrollspy').innerHeight(),
		// All list items
		menuItems = scrollspy.find('a[href=""]'),
		// // Anchors corresponding to menu items
		scrollItems = menuItems.map(function() {
			// var item = $($(this).attr("href"));
			var item = $($(this).attr("href"));
			if(item.length) {
				return item;
			}
		});
	console.log('all');

	// Bind click handler to menu items
	// so we can get a fancy scroll animation
	menuItems.click(function(e) {
		var href = $(this).attr("href"),
			offsetTop = href === "#" ? 0 : $(href).offset().top - scrollspyHeight + 1 - menuHeight;
		$('html, body').stop().animate({
			scrollTop: offsetTop
		}, 1000);
		// e.preventDefault();
	});

	// Bind to scroll
	$(window).scroll(function() {
		// Get container scroll position
		var fromTop = $(this).scrollTop();

		// fix scrollspy nav
		// if(!scrollspyFixed && fromTop >= scrollspyOffset - menuHeight ) {
		//   scrollspyFixed = true;
		//   scrollspy.addClass('fixed');
		// } else if (scrollspyFixed  && fromTop < scrollspyOffset - menuHeight ) {
		//   scrollspy.removeClass('fixed');
		//   scrollspyFixed = false;
		// }
		console.log(fromTop);

		// Get id of current scroll item
		var cur = scrollItems.map(function() {
			if($(this).offset().top < fromTop + scrollspyHeight + menuHeight + 15)
				return this;
		});
		// Get the id of the current element
		cur = cur[cur.length - 1];
		var id = cur && cur.length ? cur[0].id : "";

		if(lastId !== id) {
			lastId = id;
			// Set/remove active class
			menuItems
				.parent().removeClass("active")
				.end().filter("[href='#" + id + "']").parent().addClass("active");
		}
	});
});

